import React, {Component} from "react";
import Grid from "./Grid";
import Snake from "./Snake";
import Food from "./Food"


class App extends Component{

    constructor(props){
        super(props);


        this.state = {
            dots: [[0,0],[0,1],[0,2]]


        };

    }



    render(){



        return(
            <div className="container">
                <Grid dots={this.state.dots}/>
                <Snake />
                <Food />
            </div>
        );
    }
}

export default App;
